import React from "react";
import { SidebarContainer, Icon, CloseIcon } from "./SideBarElements";

function SideBar() {
  return (
    <SidebarContainer>
      <Icon>
        <CloseIcon />
      </Icon>
      <SidebarWrapper>
        <SidebarMenu>
          <SidebarLink to="about">About</SidebarLink>
          <SidebarLink to="about">About</SidebarLink>
          <SidebarLink to="about">About</SidebarLink>
          <SidebarLink to="about">About</SidebarLink>
        </SidebarMenu>
      </SidebarWrapper>
    </SidebarContainer>
  );
}

export default SideBar;
